import React, {Component} from 'react';
import './App.css';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from "react-router-dom";
import {combineReducers, createStore} from "redux";
import {Provider} from "react-redux";
import SearchComponent from "./components/SearchComponent";
import Home from "./Home";




class App extends Component {
    constructor(){
        super()
        this.state = {
            keyword:''
        }
    }


        reducers = combineReducers({
        reducer: this.state
    });

    store = createStore(this.reducers);

    jokes = (url) => {
        alert("Oh yeah " + this.state.keyword)
    }

keyWordChange = event =>
    console.log("event.target.value")

    render(){
  return (
      <Provider store={this.store}>
          <Router>
              <div>
                  <nav className="navbar navbar-expand-sm navbar-dark bg-dark">
                      <a className="navbar-brand" href="/">Mind-Assistant</a>

                      <div className="collapse navbar-collapse">
                          <ul className="navbar-nav mr-auto">
                          </ul>
                          <form className="form-inline">
                              <input value={this.state.keyword} onChange={this.keyWordChange} className="form-control" type="search" placeholder="Search"
                                     aria-label="Search"/>
                              <Link to={"/search"}>
                                  <button onClick={() => this.jokes("url here")} className="btn btn-outline-success my-2 my-sm-0" type="submit">Search</button>
                              </Link>
                          </form>
                      </div>
                  </nav>

                  <Switch>
                      <Route
                          path={"/search"}
                          render={(props) =>
                              <SearchComponent
                                  {...props}
                              />
                      }/>
                      <Route path={"/"}>
                          <Home/>
                      </Route>
                  </Switch>
              </div>
          </Router>
      </Provider>
  );
}
}
export default App;
